#!/usr/bin/env python3

dna = ''

total = len(dna)
dnaA = dna.count('A')
dnaT = dna.count('T')
atContent = (dnaA + dnaT) / total 

print('The AT content of this DNA sequence is:' , '{:>.2%}'.format(atContent))

dnaC = dna.count('C')
dnaG = dna.count('G')
cgContent = (dnaC + dnaG) / total

print('The CG content of this DNA sequence is:' , '{:>.2%}'.format(cgContent))
